package com.shuiyu.test.myapplication.Bean;import java.io.Serializable;public class BootList implements Serializable{	private static final long serialVersionUID = 1533347928L;	private String imgurl;	private long type;	public String getImgurl() {		return this.imgurl;	}	public void setImgurl(String imgurl) {		this.imgurl = imgurl;	}	public long getType() {		return this.type;	}	public void setType(long type) {		this.type = type;	}	public BootList() {}	public BootList(String imgurl, long type){		super();		this.imgurl = imgurl;		this.type = type;	}	public String toString() {		return "BootList [imgurl = " + imgurl + ", type = " + type + "]";	}}